    false,nt"url": null,nt"notes": "This annual narrative report for Meredosia
    National Wildlife Refuge outlines Refuge accomplishments during the 1983 calendar
    year. The report begins with Refuge highlights and climate conditions. The administration
    section discusses personnel, youth programs, funding, and safety. Habitat management
    is covered; wetlands, croplands, and wilderness and special areas are discussed.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, migratory birds, game mammals, and marking and banding. Interpretation
    and recreation activities are outlined; topics include law enforcement. Cooperative
    programs and items of interest are discussed. Equipment utilization and replacement
    is described. Cooperative programs and items of interest are also discussed. Photographs
    and brochures are attached.",nt"license_title": "License Not Specified",nt"extras":
